    <title>Ribosome Visualisation</title>
    <form method="post">
        {{ form.cases }}
        <input type="radio" id="ratio1" name="vistype" value="ratio_C/N">
        <label for="ratio">Cancer / Normal</label>


        <input type="radio" id="ratio2" name="vistype" value="ratio_N/C">
        <label for="ratio">Normal / Cancer</label>

        <input type="submit" id="submit">
    </form>
    <p id="current_case">{{ current_case }}</p>
    <script>


        let cases_select = document.getElementById('cases');
        let file_select = document.getElementById('file');


        cases_select.onchange = function () {
            let cases = cases_select.value;

            fetch(/file/ + cases).then(function (response) {
                response.json().then(function (data) {
                    let optionHTML = '';

                    for (let file of data.files) {
                        optionHTML += '<option value="' + file.id + '">' + file.id + '</option>';
                    }
                    file_select.innerHTML = optionHTML;

                });

            });
        };


    </script>
